import React from 'react';

class TilesList extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            tilesElements: props.tiles
        };
    }

    render() {
        const elements = this.state.tilesElements.map((tile) = <li>{tile}</li>);
        return <ul> {elements} </ul>;
    }

}
export default TilesList;
